Recall that our Rust view! macro input is not actually HTML. It gets processed and converted into HTML. This gives us some extra freedom, like the ability to write our own custom elements in Rust with their own templates. view! { cx, <h1>"Hello, world!"</h1> <NiceAffirmation />
} The above code will be converted into the following HTML: <h1>Hello, world!</h1>
<NiceAffirmation></NiceAffirmation> The browser doesn't know what to do with the tag <NiceAffirmation>, so it treates it as a generic element that doesn't do anything. We can define a template for our "NiceAffirmation" component and have it render our as if the element existed in the HTML spec. In a sense, we can make up our own specification for our own application using domain specific component names, and then let Leptos handle the rest. In Leptos we call custome elements components

